import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

const counterModule = {
  // namespace the module
  namespaced: true,
  state: () => {
      10

  },
  getters: {},
  mutations: {},
  actions: {}
}

export default new Vuex.Store({
   modules: {
    counterMod: counterModule
  }
})
